function selectMonthAndYear() {
  cy.get(".datepicker-dropdown").find(".datepicker-switch").first().then(function (currentDate) {
    if (!currentDate.text().includes(Year)) {
      cy.get(".next").first().click();
      selectMonthAndYear();
    }
  }).then(function () {
    cy.get(".datepicker-dropdown").find(".datepicker-switch").first().then(function (currentDate) {
      if (!currentDate.text().includes(Month)) {
        cy.get(".next").first().click();
        selectMonthAndYear();
      }
    });
  });
}
function selectPreviousMonthAndYear() {
  cy.get(".datepicker-dropdown").find(".datepicker-switch").first().then(function (currentDate) {
    if (!currentDate.text().includes(Year)) {
      cy.get(".prev").first().click();
      selectPreviousMonthAndYear();
    }
  }).then(function () {
    cy.get(".datepicker-dropdown").find(".datepicker-switch").first().then(function (currentDate) {
      if (!currentDate.text().includes(Month)) {
        cy.get(".prev").first().click();
        selectPreviousMonthAndYear();
      }
    });
  });
}
function selectDay() {
  cy.get("[class='day']").contains(Day).click();
}
if (date < cDate) {
  selectPreviousMonthAndYear();
  selectDay();
} else {
  selectMonthAndYear();
  selectDay();
}

